    df_temp['MAHALLE_ARGE'] = df_temp['Neighbourhood'].map(convert_key)
    df_temp.loc[((df_temp['İLÇE_ARGE'] == 'BAŞAKŞEHİR') & (df_temp['MAHALLE_ARGE'] == 'İKİTELLİ OSB')), 'MAHALLE_ARGE'] = 'ZİYA GÖKALP'
